import PromotionBanner from "../../components/promotion banner/PromotionBanner";
import Subscribe from "../../components/subscribe/Subscribe";
import TrendingArticle from "../../components/trending article/TrendingArticle";
import styles from "./Home.module.scss";
import Hero from "./home sections/Hero";
import Suggestions from "./home sections/Suggestions";

const Home = () => {
  return (
    <div className={styles.container}>
      <div className={`${styles.hero} ${styles.section}`}>
        <Hero />
      </div>
      <Suggestions />
      <div className={`${styles.topArticles} ${styles.section}`}>
        <PromotionBanner />
        <TrendingArticle />
      </div>
      <div className={`${styles.subscribe} ${styles.section}`}>
        <Subscribe />
      </div>
    </div>
  );
};

export default Home;
